def brainfuck_print_operator_table_table (program, output_string):
    output_string = output_string[:-2]
    new_output = []
    for ch in program.split('\n'):
        if ch == '-':
            new_output.append('-')
        elif ch == '+':
            new_output.append('+')
        elif ch == '*':
            new_output.append('*')
        else:
            raise ValueError('Unsupported operator')
        new_output.append(ch)
    new_output_string = ' '.join(new_output)
    return output_string, new_output_string
